class AddContact extends React.Component{
render ()
{
return(
    <div class="ui main">
     <h2 className="ui container center">Add Contact</h2>
        <form className="ui form">
         <div className="field">
            <label>Name</label>
            <input type="text"></input>
            <label>Name</label>
            <input type="text"></input>
             <button className="ui button">Submit</button>
         </div>
        </form>

    </div>);
}
}
